  const [value, onChange] = useState(new Date());
  let active = false;

  return (
    <div className="App">
      <DateTimePicker 
      onChange={onChange} 
      yearPlaceholder={"1999"} 
      monthPlaceholder={"04"} 
      dayPlaceholder={"21"} 
      hourPlaceholder={"00"} 
      minutePlaceholder={"00"} 
      secondPlaceholder={"00"}
    />
    {active ? <h1>{showDate(value)}</h1> : null }
    <button onClick={show()}></button>
    </div>
  );
}

export default App;
